%pyspark
from pyspark.sql.types import StructField, StringType, IntegerType, FloatType
from pyspark.sql.functions import udf

def makeInt(val):
    try:
        return int(val)
    except:
        return -999

def makeFloat(val):
    try:
        return float(val)
    except:
        return -999.0

def makeString(val):
    try:
        return str(val)
    except:
        return '-'

spark.udf.register('udf_makeInt', makeInt, IntegerType())
spark.udf.register('udf_makeFloat', makeFloat, FloatType())
spark.udf.register('udf_makeString', makeString, StringType())

spdf.withColumn('datetime', udf_makeString('datehour'))\
    .withColumn('station', udf_makeString('station'))\
    .withColumn('POP', udf_makeInt('POP'))\
    .withColumn('PTY', udf_makeInt('PTY'))\
    .withColumn('REH', udf_makeInt('REH'))\
    .withColumn('SKY', udf_makeInt('SKY'))\
    .withColumn('T3H', udf_makeInt('T3H'))\
    .withColumn('UUU', udf_makeFloat('UUU'))\
    .withColumn('VEC', udf_makeInt('VEC'))\
    .withColumn('VVV', udf_makeFloat('VVV'))\
    .withColumn('WSD', udf_makeFloat('WSD'))
